  false,\n\t\"url\": null,\n\t\"notes\": \"The University of Alaska, Institute of
  Marine Science is responsible fornthis data collected aboard the R/V Alpha Helix
  on cruise number HX123nbetween May 5, 1989 to May 11, 1989 by Dr. R.T. Cooney of
  the Institutenof Marine Science. There was a total of 51 stations in the PrincenWilliam
  sound area. The station numbers are: 2-52. These data werencollected for the Exxon
  Oil Spill Monitoring Program. Funding wasnprovided by the State of Alaska. This
  data was submitted to NODCnearlier. This data set represents a resubmission due
  to fact that thenearlier version had the wrong offsets applied. Field correction
  for thenSTD data was derived by comparing single bottle samples to recordednvalues
  from the STD sensors. The field correction is based on 15 samplesnfrom a total of
  16 stations. The field corrections are: 3000 m CTDntemperature mean (Nansen-STD)
  is 0.00536 and 3000 m CTD salinity meann(Nansen-STD) is -0.04131.\",\n\t\"owner_org\":
